  the U.S. Geological Survey and the National Oceanic and Atmospheric Administration
  offshore of Massachusetts between Duxbury and Hull (DH_hlshd5m, Esri binary grid,
  UTM Zone 19, WGS84)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 19,\n\t\t\"recent\":
